    @Test
    public void normal() {
        // The seller public key to create tranche.
        String sellerPrivateKey = "privC15YAp4M4oDLcJ6JqyPqYH55VXPeNckE2AVqWcHN8BB4PAVwGjJr";
        // The seller address.
        String sellerAddress = "buQfTPaQBzFGBzGy87pSsc6MmNJKKKmzTSyC";
        // The tranche id.
        String trancheId = "1";
        // The tranche description.
        String trancheDesc = "有效期";
        // The start time, the unit is ms.
        String startTime = "1517032155872949";
        // The end time, the unit is ms.
        String endTime = "1517470155872949";

        // Creating tranche.
        Atp60TokenDemo atp60TokenDemo = new Atp60TokenDemo();
        String txHash = atp60TokenDemo.createTrancheTx(sellerPrivateKey, sellerAddress, trancheId, trancheDesc, startTime, endTime);

        // Check Tx status.
        JSONObject result = atp60TokenDemo.getTxStatus(txHash);
        System.out.println(JSON.toJSONString(result, true));
        assertEquals(result.getString("desc"), 0, result.getIntValue("code"));
    }

